import React from "react";
import {Card,Container,CardBody,CardTitle,CardText,CardImg} from "reactstrap";
import {FaEnvelope,FaMapMarkedAlt,FaPhone,FaPortrait} from "react-icons/fa"


const MyCard = ({details})=>{
    return(
        <Card>
                <CardImg top width="100%" src={details.picture?.large}/>
                <CardTitle className="text-primary">
                    <CardText>
                    <h1>
                        <span className="pr-2">{details.name?.title}</span>
                        <span className="pr-2">{details.name?.first}</span>
                        <span className="pr-2">{details.name?.last}</span> 
                    </h1>
                    </CardText>
                </CardTitle>
                <CardText>
                    <FaMapMarkedAlt className="pr-1" height="50px" />
                    {details.location?.city}
                    <p>{details.phone}</p>
                </CardText>
        </Card>
    )
}



export default MyCard;
